import React, {Component } from 'react';
import { Link } from 'react-router-dom';
import axios from '../api/axios'

function getItem(item_id){
    const URL = `http://127.0.0.1:8080/api/item/id/${item_id}`
    fetch(URL)
    .then(response => response.json())
    .then(data => {
        if (data[0]['favorite_items'] == '') {
            setUserFavoritesItem([])
        } else {
            setUserFavoritesItem(data[0]['favorite_items'].split(','))
        }
    })
    .catch(err => console.log(err))
    axios.get(URL).then((response) => {
        const itemInfo = response.data[0]
        console.log(itemInfo)
        return itemInfo
      });
}

function FavoriteItem (item_id) {
        const item = getItem(item_id.item)
        console.log(item)

        return (
                <Link to={`/`} className='items-card' >
                    <img src={'/'}/>
                </Link>
        )

}

export {FavoriteItem}
